EuclideanGraph build_graph(const SLList<Point2D>& nodes, const SLList<tuple<nat_t, nat_t, double>>& arcs)
{
  EuclideanGraph g;

  DynArray<Node<EuclideanGraph>*> pnodes(nodes.size());

  for (const auto& p : nodes)
    pnodes.append(g.insert_node(p));

  for (const auto& p : arcs)
    g.insert_arc(pnodes[get<0>(p)], pnodes[get<1>(p)], get<2>(p));

  return g;
}

bool less_points(const Point2D& p, const Point2D& q)
{
  if (p.get_x() < q.get_x())
    return true;
  
  if (p.get_x() > q.get_x())
    return false;
  
  return p.get_y() < q.get_y();
}

bool less_nodes(Node<EuclideanGraph>* p, Node<EuclideanGraph>* q)
{
  return less_points(p->get_info(), q->get_info());
}

bool less_arcs(Arc<EuclideanGraph>* a, Arc<EuclideanGraph>* b)
{
  if (a->get_info() < b->get_info())
    return true;
  
  if (a->get_info() > b->get_info())
    return false;
  
  if (less_nodes(a->get_src_node(), b->get_src_node()))
    return true;
  
  if (less_nodes(b->get_src_node(), a->get_src_node()))
    return false;
  
  return less_nodes(a->get_tgt_node(), b->get_tgt_node());
};

bool eq(const EuclideanGraph& gr_g, const EuclideanGraph& st_g)
{
  if (gr_g.get_num_nodes() != st_g.get_num_nodes() or
      gr_g.get_num_arcs() != st_g.get_num_arcs())
    return false;

  auto eq_arcs = [] (Arc<EuclideanGraph>* a, Arc<EuclideanGraph>* b)
    {
      return real_equal(a->get_info(), b->get_info()) and
      (a->get_src_node()->get_info() == b->get_src_node()->get_info() and
      a->get_tgt_node()->get_info() == b->get_tgt_node()->get_info()) or
      (a->get_src_node()->get_info() == b->get_tgt_node()->get_info() and
      a->get_tgt_node()->get_info() == b->get_src_node()->get_info());
    };
  
  auto eq_nodes = [&gr_g,&st_g,&eq_arcs] (Node<EuclideanGraph>* p, Node<EuclideanGraph>* q)
    {
      if (p->get_info() != q->get_info())
	      return false;
      
      return sort(gr_g.adjacent_arcs(p), less_arcs).equal(sort(st_g.adjacent_arcs(q), less_arcs), eq_arcs);
    };
  
  if (not sort(gr_g.nodes(), less_nodes).equal(sort(st_g.nodes(), less_nodes), eq_nodes))
    return false;
  
  return sort(gr_g.arcs(), less_arcs).equal(sort(st_g.arcs(), less_arcs), eq_arcs);
}

